import React from 'react'

export default function categoryReaction() {
  return (
    <div>
      <div className="toggle-wrapper">
        {active ? (
          <img
            className="active"
            src={Active}
            alt="yellow star"
            onClick={() => handleChangeActive()}
            height={30}
            width={30}
          />
        ) : (
          <img
            className="inactive"
            src={Inactive}
            alt="black and white star"
            onClick={() => handleChangeActive()}
            height={30}
            width={30}
          />
        )}
      </div>
    </div>
  )
}
